import React from "react";
import "./navbar.css";
// import icons from "./download/menu.svg";

class Navbar extends React.Component {
   constructor() {
      super();
      this.state = {
         isMenu: false,
      };
   }
   render() {
      return (
         <div className="Navbar_wapp">
            <div className="logo">
               <h2>
                  <a href="#home">Sivaramakrishnan</a>
               </h2>
            </div>
            <nav
               className={`navbar_mobile ${this.state.isMenu ? "isMenu_on" : "isMenu_off"
                  }`}
            >
               <ul>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#home">
                        {/* <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 576 512">
                           <path d="M575.8 255.5C575.8 273.5 560.8 287.6 543.8 287.6H511.8L512.5 447.7C512.5 450.5 512.3 453.1 512 455.8V472C512 494.1 494.1 512 472 512H456C454.9 512 453.8 511.1 452.7 511.9C451.3 511.1 449.9 512 448.5 512H392C369.9 512 352 494.1 352 472V384C352 366.3 337.7 352 320 352H256C238.3 352 224 366.3 224 384V472C224 494.1 206.1 512 184 512H128.1C126.6 512 125.1 511.9 123.6 511.8C122.4 511.9 121.2 512 120 512H104C81.91 512 64 494.1 64 472V360C64 359.1 64.03 358.1 64.09 357.2V287.6H32.05C14.02 287.6 0 273.5 0 255.5C0 246.5 3.004 238.5 10.01 231.5L266.4 8.016C273.4 1.002 281.4 0 288.4 0C295.4 0 303.4 2.004 309.5 7.014L564.8 231.5C572.8 238.5 576.9 246.5 575.8 255.5L575.8 255.5z" />
                        </svg> */}
                        <i className="fas fa-home"></i>Home
                     </a>
                  </li>
                  {/* <li><a href="#about">About</a></li> */}
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#skills">
                        <i className="fas fa-graduation-cap"></i>Skills
                     </a>
                  </li>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#work">
                        <i className="fas fa-desktop"></i>Work
                     </a>
                  </li>
                  <li
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#contact">
                        <i className="fas fa-user"></i>Contact
                     </a>
                  </li>
                  <li
                     className="login"
                     onClick={() => {
                        this.setState({ isMenu: !this.state.isMenu });
                     }}
                  >
                     <a href="#login">Login</a>
                  </li>
               </ul>
            </nav>
            <div
               className="menu"
               onClick={() => {
                  this.setState({ isMenu: !this.state.isMenu });
               }}
            >
               <i className="fas fa-bars"></i>
            </div>
         </div>
      );
   }
}

export default Navbar;
